(67048, '7MTV96PZ', '3 i 1 LED oplader med magnetisk hoved 1m', '18a90800-9517-11ea-965e-af1c61b9ee2b.png', '16-07-2020-1594894304-3-i-1-led-oplader-med-magnetisk-hoved-1m', '3 i 1 betyder at du med denne oplader har tre magnetiske hoveder, som du kan skifte mellem. Du kan oplade enheder med type-c, 8pin og micro porte', '<p>Denne oplader har en gennemsigtig overflade med LED lys indeni i farven (hvid/bl√•). Det g√∏r det muligt for dig at se et flow, n√•r opladeren er sat i stikkontakten og tilknyttet din mobile enhed. Var det noget med en smart ‚Äùnatlampe‚Äù eller noget LED i bilen, s√• er denne opladere lige noget for dig.&nbsp;</p><p>3 i 1 betyder at du med denne oplader har tre magnetiske hoveder, som du kan skifte mellem. Du kan oplade enheder med type-c, 8pin og micro porte.&nbsp;</p><p>Bliv fortryllet af at se LED lyset og flowet, n√•r din smartphone, tablet eller anden enhed bliver opladt.&nbsp;</p><p>Produktets specifikationer:</p><p>Anvendelse: Kamera, PC, Mobil, Iphone, Android,&nbsp;MP3/MP4 mv.<br>Materiale: Aluminium<br>Ydre: PVC<br>L√¶ngde: V√¶lg mellem 1 eller 2 meter<br>Output: 2.1A<br>Porte: Type C, 8pin, micro<br>Farve: V√¶lg mellem Bl√• eller hvid<br>V√¶gt: 35g</p>', '2', 22, 47, 200.00, 139.00, 109.00, '[\"Men\",\"Women\"]', 25, 100, 0.30, 139, 13.9, 10, 5, '2020-07-23 12:00:00', NULL, '2020-07-16 10:00:00', 1, 16, 0, '2020-05-13 12:41:42', '2020-07-16 17:02:34'),
(67049, '9D4N9J3H', '3 i 1  oplader med roterende magnetisk hoved', 'f218d920-9518-11ea-9e56-cdfa8e3205f6.png', '16-07-2020-1594894354-3-i-1-oplader-med-roterende-magnetisk-hoved', 'Den rette oplader til gameren', '<p>Denne magnetiske oplader har et roterende hoved. Med 3 i 1 menes der at opladeren kan anvendes p√• enheder som smartphones, tablets mv. der har type-c port, 8 pin port (Iphone) eller micro port. Overfladen af ledningen er udstyret nylon og stof, der giver et fedt look af at det er flettet.&nbsp;</p><p>T√¶nk ikke over hvor du sidst har gemt dine ‚Äùhoveder/stik‚Äù, da du med denne magnetiske oplader f√•r et holder som kan s√¶ttes fast til ledningen.</p><p>Opladerens roterende hoved p√• 90 grader g√∏r den ideel for alle os der elsker at spille p√• vores Smartphone og tablet. Det roterende hoved fjerne udfordringen ved at spille imens man oplader. Vi alle kender til f√∏lelsen af at batteriniveauet falder, s√• hvorfor ikke bruge denne oplader med 2 meter lang ledning uden at blive forstyrret?&nbsp;<br><br>&nbsp;</p><p>Opladerens specifikationer</p><p>Specifikationer:</p><p>Anvendelse: Kamera, PC, Iphone, Android, MP3/MP4 mv.<br>Materiale: Nylon og&nbsp;aluminium<br>Funktion: Opladning (magnetisk)<br>L√¶nge: 2 meter<br>Farve: Sort eller r√∏d<br>Porte: Type C, 8pin, micro</p>', '1', 22, 47, 200.00, 189.00, 139.00, '[\"Women\"]', 28, 50, 1.00, 179.64, 18.9, 10, 5, '2020-07-22 12:00:00', NULL, '2020-07-16 09:00:00', 0, 16, 0, '2020-05-13 12:54:57', '2020-07-29 14:39:58'),
(67050, 'DORV9U9A', 'H√¶ngel√•s med fingeraftryk', '17305420-951a-11ea-afcc-2b437d592f36.png', '16-07-2020-1594894703-haengelas-med-fingeraftryk', 'Har du glemt hvor n√∏glen til k√¶lderen ligger? Intet problem bare du har din finger med dig. Med denne h√¶ngel√•s kan du anvende dine fingeraftryk til at l√•se op for l√•sen. Smart l√•s som ikke kr√¶ver at du har n√∏glebundtet med dig.', '<p>Har du glemt hvor n√∏glen til k√¶lderen ligger? Intet problem bare du har din finger med dig. Med denne h√¶ngel√•s kan du anvende dine fingeraftryk til at l√•se op for l√•sen. Smart l√•s som ikke kr√¶ver at du har n√∏glebundtet med dig.&nbsp;</p><p>Du kan registrere op til 10 forskellige fingeraftryk og l√•sen har et indbygget batteri, som kan klare op til 6 m√•neder uden opladning. En fuld opladning g√∏r at du kan scanne din finger i op til 9 tusind gange. Litium batteriet er let opladeligt gennem medf√∏lgende USB kabel. Skulle din l√•s l√∏be t√∏r for str√∏m, s√• f√•r du den snildt op at k√∏re igen med en n√¶rliggende stikkontakt eller en powerbank.&nbsp;</p><p>Responstiden ligger p√• ca. 1 sekund for at h√¶ngel√•sen l√•ses op. L√•sen kan ogs√• klare temperaturer p√• -20 grader og helt op p√• 65 grader.&nbsp;</p><p>H√¶ngel√•sens specifikationer:</p><p>Funktion: L√•s op med fingeraftryk</p><p>Opladningstid: 1-2 timer<br>Opl√•sning: Op til 9000 gange ved en fuld opladning<br>Batteritid: Op til et halvt √•r<br>Battritype: 3.7V Lithium batteri<br>Temperatur: -20¬∞C til 65¬∞C<br>Str√∏m: 3.0-4.2V<br>Str√∏mforsyning: Micro USB<br>Antal fingeraftryk: Op til 10<br>Dimensioner: 11x8x2 cm<br>V√¶gt: 150g</p>', '0', 23, 47, 350.00, 289.00, 229.00, '[\"All\"]', 8, 100, 0.60, 288.4, 28.9, 10, 5, '2020-07-20 12:00:00', NULL, '2020-07-16 09:00:00', 0, 16, 1, '2020-05-13 13:03:08', '2020-07-20 14:34:42'),
(67051, 'MXXZAAZE', 'Aroma Classic', '7becc6d0-951b-11ea-855a-5d33c88323e5.png', '16-07-2020-1594894785-aroma-classic', 'Formalet kaffe fra AromaCoffee', '<p>Klassisk formalet kaffe fra producenten AromaCoffee som kan f√•s i poser p√• 500g. Denne kvalitetskaffe er mellemristet og kategoriseret som Balance ud fra producentens fire filtre ‚Äì Smooth, Balance, Bright og intense.&nbsp;</p><p>Specifikationer:</p><p>V√¶gt: 500g</p>', '0', 24, 51, 100.00, 89.00, 59.00, '[\"Men\",\"Women\",\"Kids\"]', 11, 100, 0.30, 89, 8.9, 10, 5, '2020-07-30 12:00:00', NULL, '2020-07-16 10:00:00', 0, 16, 0, '2020-05-13 13:13:06', '2020-07-29 14:53:18'),
