(67055, 'SA44VOL5', 'Robotst√∏vsuger - Liectroux C30B', '718cc4b0-98e4-11ea-9d39-3dada4cdf77c.png', '16-07-2020-1594894902-robotstovsuger-liectroux-c30b', 'Reng√∏r hjemmet med denne robotst√∏vsuger. Vores robotst√∏vsuger er rig p√• funktionalitet og ideelt til det smarte hjem. Klik ind p√• app‚Äôen og kom hjem til et rent hjem.', '<p>Denne enhed er udstyret med to slags tanke ‚Äì √©n tank til st√∏v med en kapacitet p√• 600ml og √©n vandtank med moppe p√• 350ml. Det g√∏r at du kan st√∏vsuge og reng√∏re flere overflader.</p><p>Vores intelligente robotst√∏vsuger tilkobles dit hjemmenetv√¶rk gennem Wi-Fi og forbindes med app‚Äôen. Herefter kan du anvende den praktiske og udviklede V-b√∏rste s√• du kan st√∏vsuge p√• overflader som tr√¶gulv, t√¶pper, marmor og keramik.&nbsp;</p><p>Robotst√∏vsuger funktioner og specifikationer:<br>Kort position ‚Äì Enheden ved hvor den er henne.<br>2D mappe ‚Äì Du kan gennem app‚Äôen se st√∏vsugede omr√•der<br>App kontrol ‚Äì Du kan styre alt gennem app‚Äôen<br>Smart hukommelse: Det intelligente system gemmer p√• data<br>B√∏rstefri motor ‚Äì St√∏vsugeren har V-b√∏rste og side b√∏rster og ikke i motoren.<br>Plantegning: St√∏vsugeren tegner et kort over det st√∏vsugede areal<br>Smart adskillelse ‚Äì N√∏jagtig og god til at adskille rum og skillev√¶gge<br>Enkeltrums reng√∏ring ‚Äì Kan indstilles til kun at reng√∏re et bestemt rum<br>Justerbar hastighed ‚Äì Du bestemmer hvor hurtigt og grundigt det skal v√¶re<br>Zigzag reng√∏ring ‚Äì F√•r hele gulvet med sig<br>Lang v√¶gge reng√∏ring ‚Äì Med U-vending funktionen f√•r du alle kanterne med<br>Auto reng√∏ring ‚Äì Kan indstilles til automatisk reng√∏ring af omr√•der<br>Fokuseret reng√∏ring ‚Äì Hvis et fast omr√•de er valgt&nbsp;<br>Husker glemte steder ‚Äì Hvis st√∏vsugeren skal oplade sig under reng√∏ring, forts√¶tter den hvor den slap.<br>Tidsbestemt ‚Äì Indstil robotten til at st√∏vsuge p√• bestemte tidspunkter<br>Stemme ‚Äì Robotten har en stemme, som informere dig om st√∏vsugningen<br>Smart vandtank ‚Äì med moppe<br>3000Pa Sugeevne ‚Äì robotst√∏vsuger med st√¶rk sugeevne<br>Stor st√∏vbeholder ‚Äì 600ml.&nbsp;<br>Stor vandtank ‚Äì 350ml.</p><p>H√∏jde: 74mm<br>Moppest√∏rrelse: 316x177x4mm<br>St√∏vsuger kapacitet: 600ml<br>Vandtank kapacitet: 350ml<br>Sp√¶nding: 14.4V<br>Str√∏mstyrke: 28W<br>Opladning: Automatisk/Manuelt<br>Batteritid: 100min.<br>Batteri: 2500MAH li-ion<br>Operationstemperatur: -10¬∞C&nbsp;- 45¬∞C&nbsp;<br>Certifikater: CE, FCC, RoHS<br>Nettov√¶gt: 2,7kg</p><p>V-forms b√∏rste forhindre ‚Äùanti-twining‚Äù, alts√• at den sidder fast. Samtidig er b√∏rsten form med til at der st√∏vsuges st√∏v, b√∏nner, aske, rester, partikler, h√•r og flydende st√∏v.&nbsp;</p><p>Som mange andre Smarthome produkter vi har p√• JoinOffers anvender vi med denne robotst√∏vsuger samme app udbyder, s√• du ikke skal fifle rundt mellem flere app, men blot bruge en app til dine Smarthome enheder.&nbsp;</p>', '5', 26, 52, 3699.00, 3599.00, 3299.00, '[\"Men\",\"Women\"]', 77, 100, 3.00, 3272.09, 359.9, 10, 5, '2020-08-01 13:00:00', NULL, '2020-07-17 08:00:00', 0, 16, 0, '2020-05-18 08:49:11', '2020-07-29 14:38:24'),
(67056, 'HBLJQUTO', 'Smart Wi-Fi Alarm - IS-G300', '460ed2b0-98e8-11ea-a901-811fde52a77c.png', '16-07-2020-1594895048-smart-wi-fi-alarm-is-g300', 'Denne og andre produkter i vores SmartHome kategori, kan alle tilknyttes samme app.', '<p><strong>Smart alarmsystem til dit hjem.</strong></p><p>Vi kender alle matematikken ‚Äì et sikkert hjem er lig med et alarmsystem. Hvorfor ikke have et smart alarmsystem rig p√• funktionalitet og som giver dig en tryghed ikke mindst n√•r du er ude, men ogs√• n√•r du er hjemme. Alarmen fungerer ogs√• ideelt til husdyrsejere, da du vil modtage en notifikation, hvis dit k√¶ledyr bryder ud. Omvendt f√•r du ogs√• besked hvis nogen pr√∏ver at bryde ind i dit hjem.&nbsp;</p><p>Det f√•r du med i startpakken for smart alarmen:<br>1x Kontrolpanel<br>2x Fjernbetjeninger<br>1x D√∏r/vinduemagnet<br>2x Chip/brikker<br>1x Bev√¶gelsesdetektor<br>1x Sirene</p><p>Selve enheden er let betjenelig og ops√¶tningen kr√¶ver ikke en mont√∏r. En smule h√•ndkraft og en smartphone, s√• du godt k√∏rende med dit alarmsystem. Du kan koble kontrolpanelet til dit Wi-Fi netv√¶rk og is√¶tte et SIM-kort hvis du √∏nsker at enheden ogs√• skal sende SMS og ringe dig op. Du kan gennem app‚Äôen styre systemet og indstillingerne.&nbsp;<br><br>De to fjernbetjeninger kan bruges hvis s√• du som med bilen kan sl√• alarmen til, fra, p√• hjemmefunktion eller SOS i tilf√¶lde af at du befinder dig i dit hjem, imens nogen pr√∏ver at bryde ind. Du kan indstille en kode til samme form√•l eller anvende de to RFID-chips. Kontrolpanelet har ligeledes SOS knappen. Sirenen lydstyrke er h√∏j og denne g√•r i gang i tilf√¶lde af at d√∏r/vinduemagneten ikke m√∏der hinanden eller at bev√¶gelsesdetektoren opfanger bev√¶gelser i hjemmet.&nbsp;</p><p>Vores smarte alarmsystem kan ligeledes som de √∏vrige begivenheder i kategorien for SmartHome styres gennem samme app. Du kan dermed have alt samlet et sted.&nbsp;</p><p>&nbsp;</p>', '3', 27, 52, 2199.00, 1999.00, 1799.00, '\"All\"', 57, 50, 4.00, 1993, 199.9, 10, 5, '2020-07-27 12:00:00', NULL, '2020-07-16 10:00:00', 0, 16, 0, '2020-05-18 09:16:37', '2020-08-06 16:34:20'),
(67057, 'KXWMJSOP', 'Telefonholder til bags√¶det', 'caa10210-98ed-11ea-95af-d14a30a69e6d.png', '16-07-2020-1594888306-telefonholder-til-bagsaedet', 'Skab din egen underholdning p√• bags√¶det. Hvad med en lille bilbio?', '<p><strong>Underholdning p√• bags√¶det</strong></p><p>Med denne magnetiske telefonholder kan du underholde passagererne p√• bags√¶det under turen. Du skal blot s√¶tte enheden p√• nakkest√∏tten og placere magnet brikken p√• din telefon. Du har ogs√• mulighed for at s√¶tte en tablet op, s√•fremt det er to magnetholdere p√• nakkest√∏tten.&nbsp;</p><p>Gl√¶d de sm√• p√• turen med en film eller nogle videoer med deres favorit figurer. Vi ved det kan v√¶re sv√¶rt at holde sig stille, s√• hvorfor ikke have sin egen ‚Äùbil bio‚Äù?.&nbsp;<br><br>Du har mulighed for at anvende produktet i alle vinkler, da du kan dreje telefonen med 360 grader.&nbsp;</p><p>Telefon holderens specifikationer:</p><p>Type: Fleksibel telefon holder<br>Anvendelse: Til bil&nbsp;<br>Funktion: 360 grader<br>V√¶gt: 120g</p><p>&nbsp;</p>', '4', 29, 53, 183.00, 139.00, 99.00, '[\"Men\",\"Women\",\"Kids\"]', 52, 100, 0.40, 139, 13.9, 10, 5, '2020-07-25 12:00:00', NULL, '2020-07-15 12:00:00', 0, 16, 0, '2020-05-18 09:56:07', '2020-08-06 16:34:00'),
